module(..., package.seeall)

new = function ( params )
	soundController.killAll()
	Runtime:removeEventListener( "system", systemEvent )
	
	soundController.playNew{
					path = "assets/sound/mainScreen.mp3",
					loops = -1,
					pausable = false,
					staticChannel = 6,
					actionTimes = {},
					action =	function()
								end,
					onComplete = function()
								end
					}
	------------------
	-- Imports
	------------------
