	local function killAll()
		paused = nil
		if trumpetAnimation then if trumpetAnimation.kill then trumpetAnimation.kill() end end
		if landingQueenAnimation then if landingQueenAnimation.kill then landingQueenAnimation.kill() end end
		if charmingQueenAnimation then if charmingQueenAnimation.kill then charmingQueenAnimation.kill() end end
		if marySproutingWingsAnimation then if marySproutingWingsAnimation.kill then marySproutingWingsAnimation.kill() end end
		if sceneTransition then if sceneTransition.kill then sceneTransition.kill() end end
		new = nil
