	---------------------------------------------------------------------------------------------------------
	function particles()
		for i=1,30 do
			local star1 = { imgStart = { life = rdm(1000,2000), alpha = 0.8, size = {2.5,2.5}, stroke={0,150,255,255}, pos = {0,0,rdm(-10,10),rdm(-5,5)},color={200,200,255,255}},
							imgEnd = { onComplete = nil, alpha = 0.1, scale ={1,1},pos={0,0,rdm(-20,20),rdm(-70,-40),move = 1, ease = easing.outQuad}},
							imgInfo = { group = aGroup, max = 60}}
			gPS.newCircle(star1)
		end
	end
	
	---------------------------------------------------------------------------------------------------------
	function startStar(group)
		local star1 = { imgStart = { life = rdm(600,1000), alpha = 0.6, size = {4,4}, stroke={}, pos = {0,0,rdm(-5,5),rdm(-5,5)},color={250,250,150,255}},
							imgEnd = { onComplete = nil, alpha = 0.3, scale ={1,1},pos={0,0,rdm(-50,50),rdm(-50,50),move = 1, ease = easing.outQuad}},
							imgInfo = { group = group, max = 60}}
		gPS.newCircle(star1)
	end
	
	---------------------------------------------------------------------------------------------------------
	function startPink(group)
		local star1 = { imgStart = { life = rdm(600,1000), alpha = 0.6, size = {4,4}, stroke={}, pos = {0,0,rdm(-5,5),rdm(-5,5)},color={250,150,150,255}},
