		local animate
		
		local function kill()
			blinks.stopBlinking()
			
			localGroup:remove(background)
			animation.kill()
			
			kill=nil
			landingQueenAnimation.kill=nil
			landingQueenAnimation = nil
		end
		landingQueenAnimation.kill = function()
			pauseIt = nil
			continueIt = nil
			
			Runtime:removeEventListener( "enterFrame", animate )
			kill()
		end
		
		local function vanish()
			vanish = nil
			pauseIt = nil
			continueIt = nil
			
			if animation then
				animation.stop()
			end
			
			timer.performWithDelay(500,continue)
			timer.performWithDelay(2000,kill)
		end
		
		local pauseState = paused
		
		local forceFinish = false
		animate = function()
			if pausedState ~= paused then
				pausedState = paused
				if paused then
					animation.stop()
					blinks.stopBlinking()
				else
					animation.start()
					blinks.startBlinking()
				end
				return
			end
			
			--local finished = (math.floor(animation.getFrameCount()) == math.floor(animation.getActualFrame())) or forceFinish
			--if finished and animation.isMoving then
			local finished = (math.floor(animation.getFrameCount()) == math.ceil(animation.getActualFrame())) or forceFinish
			if finished then
				animation.stop()
				Runtime:removeEventListener( "enterFrame", animate )
				if vanish then
					vanish()
				end
			end
			if animation.publicComponents then
				for i=1, #animation.publicComponents do
					if startStar then startStar(animation.publicComponents[i].displayObject) end
				end
			end
		end
		
		landingQueenAnimation.start = function ()
			soundController.playNew{
