						action =	nil,
						onComplete = nil
						}
			
			animation.start()
			animation.appear(300)
			
			blinks.openEyes()
			blinks.startBlinking()
			
			background.isVisible = true
			background.alpha = 1
			transition.to(background,{alpha=1,time=300})
			
			Runtime:addEventListener( "enterFrame", animate )
			
			local function marySound()
				soundController.playNew{
							path = "assets/sound/voices/cap2/adv2_MWingsShiny.mp3",
							duration = 3000,
							actionTimes = {0},
							action =	function()
											nextSubtitle()
										end,
							onComplete = function()
											forceFinish = true
										end
							}
				marySound = nil
			end
			soundController.playNew{
						path = "assets/sound/voices/cap2/adv2_N1.mp3",
						duration = 6000,
						actionTimes = {0},
						action =	function()
										nextSubtitle()
									end,
						onComplete = function()
										if marySound then
											marySound()
										end
									end
						}
			
			pauseIt = function()
				animation.stop()
				blinks.stopBlinking()
				Runtime:removeEventListener( "enterFrame", animate )
			end
			continueIt = function()
				animation.start()
				blinks.startBlinking()
				Runtime:addEventListener( "enterFrame", animate )
			end
		end
	end
	
