		local lastSpark = 0
		
		animationLoop = function()
			if paused then Runtime:removeEventListener( "enterFrame", animationLoop ); return end
			if not aGroup then Runtime:removeEventListener( "enterFrame", animationLoop ); return end
			local touched = false
			if math.floor(actualFrame) == 240 and not(math.floor(actualFrame) == lastSpark) then
				aGroup.x = sparkPoint.displayObject.x
				aGroup.y = sparkPoint.displayObject.y
				particles()
				for i=1, #girlsAnimation.publicComponents do
					if girlsAnimation.publicComponents[i].number==1 then
						local newXScale = girlsAnimation.publicComponents[i].displayObject.xScale * 1.25
						local newYScale = girlsAnimation.publicComponents[i].displayObject.yScale * 1.25
						transition.to(girlsAnimation.publicComponents[i].displayObject,{xScale=newXScale, yScale=newYScale,time=600})
					end
				end
				lastSpark = 240
				blueBlinks.closeEyes()
				touched = true
			elseif math.floor(actualFrame) == 320 and not(math.floor(actualFrame) == lastSpark) then
