						local newYScale = girlsAnimation.publicComponents[i].displayObject.yScale * 1.25
						transition.to(girlsAnimation.publicComponents[i].displayObject,{xScale=newXScale, yScale=newYScale,time=600})
					end
				end
				lastSpark = 320
				maryBlinks.closeEyes()
				touched = true
			elseif math.floor(actualFrame) == 405 and not(math.floor(actualFrame) == lastSpark) then
				aGroup.x = sparkPoint.displayObject.x
				aGroup.y = sparkPoint.displayObject.y
				particles()
				for i=1, #girlsAnimation.publicComponents do
					if girlsAnimation.publicComponents[i].number==3 then
						local newXScale = girlsAnimation.publicComponents[i].displayObject.xScale * 1.25
						local newYScale = girlsAnimation.publicComponents[i].displayObject.yScale * 1.25
						transition.to(girlsAnimation.publicComponents[i].displayObject,{xScale=newXScale, yScale=newYScale,time=600})
					end
				end
				lastSpark = 405
				blackBlinks.closeEyes()
				touched = true
			end
			
			if touched then
				soundController.playNew{
						path = "assets/sound/effects/cap2/wandtouchtinkle.mp3",
						actionTimes = nil,
						action =	nil,
						onComplete = nil
						}
			end
			
			if actualFrame < frameCount then
				setFrame(actualFrame)
				
				local curTime = system.getTimer();
				local dt = curTime - prevTime;
				local fps = 1000/dt
				prevTime = curTime;
            	
				actualFrame = actualFrame + (speed * 60/fps)*0.8
				
				if queenAnimation.publicComponents then
					for i=1, #queenAnimation.publicComponents do
						if startStar then startStar(queenAnimation.publicComponents[i].displayObject) end
					end
				end
			else
				Runtime:removeEventListener( "enterFrame", animationLoop )

				queenAnimation.stop()
				girlsAnimation.stop()
				
				vanish()
			end
		end
		
