			pauseIt = function()
				girlsAnimation.stop()
				queenAnimation.stop()
				maryBlinks.startBlinking()
				blackBlinks.stopBlinking()
				blueBlinks.stopBlinking()
				queenBlinks.stopBlinking()
				Runtime:removeEventListener( "enterFrame", animationLoop )
			end
			
