				queenAnimation.start()
				maryBlinks.startBlinking()
				blackBlinks.startBlinking()
				blueBlinks.startBlinking()
				queenBlinks.startBlinking()
				Runtime:addEventListener( "enterFrame", animationLoop )
				prevTime = system.getTimer();
			end
		end
	end
	
